=","upcoming_event":null,"edge_media_to_tagged_user":{"edges":[]},"accessibility_caption":"Photo by TRT World on September 05, 2021. May be an image of standing and text that says 'TRTWORLD /COVID-19 'Mu' coronavirus variant behind Colombia's deadliest pandemic wave'.","attribution":null,"shortcode":"CTcAB_wqTlL","edge_media_to_caption":{"edges":[{"node":{"text":"A new coronavirus variant known as \"Mu,\" identified first in Colombia in January, has now become the country's predominant strain and behind its deadliest pandemic wave yet, a health official said.\n\nOn Tuesday, the World Health Organization declared Mu, scientific name B.1.621, a \"variant of interest.\"\n\nIt said the variant has mutations that indicate a risk of resistance to vaccines and further studies were needed to better understand it.\n\nThe variant was responsible for Colombia's deadly third infection wave between April and June, health official Marcela Mercado told a local radio station.\n\nDuring this period, with about 700 deaths per day, nearly two-thirds of tests from people who died came back positive for the Mu variant, she said.\n\n\"It is already in more than 43 countries and has shown high contagiousness,\" she added.\n\nThe WHO lists four coronavirus variants of concern, including Alpha, present in 193 countries, and Delta, in 170.\n\nColombia recently has counted around 100 Covid-19 deaths and 2,000 infections per day, on average.\n\nLess than a third of Colombians have been vaccinated against the virus, which has claimed nearly 125,000 lives in the country to date. Photo: Vanessa Jimenez / AFP\n\u2022\n#MuVariant #Colombia #Covid19 #CoronavirusPandemic"}}]},"edge_media_preview_comment":{"count":22,"page_info":{"has_next_page":true,"end_cursor":"QVFBR01FdnNGckRKYldnZWRjdVVSQWJyQWhGTDF5a2ZVN1FKUEpKVFh1RklFOVlCX0ZYdWhXMkQ0Tjd0b3hXVmhDWE9SdzQxVG1QcnFCVFF3ZzFDR2dEdQ=="},"edges":[{"node":{"id":"17907915794097871","text":"When will be ME-E (goat) type?","created_at":1630874572,"did_report
